B.BY=A.a(s(["The road to love may feel bumpy, but there's potential beneath the surface. With patience and clear communication, you can nurture this bond and watch it flourish over time.","There\u2019s still room to understand one another better, but the love you seek is not far away. Don\u2019t rush; let your connection develop organically as you both learn and grow.","While things may not be easy now, you're at the start of something that could bloom with dedication. Continue to open your hearts, and you might be surprised at where this journey takes you. Even the longest journey begins with a single step."]),t.s)
B.Cp=A.a(s(["Though your connection may have some rough edges, there's beauty in imperfection. Love is about navigating the ups and downs with grace. Keep your hearts open and your patience strong.","You may find challenges ahead, but these tests can strengthen your bond. Take the time to appreciate what each brings to the table, and your love will mature in time.","Right now, your bond may feel a bit fragile, but with tenderness and understanding, it can evolve into something strong. Give each other space to grow and watch your love flourish. A flower blossoms best with care."]),t.s)
B.Cg=A.a(s(["Your relationship sits on a steady middle ground. There's potential to deepen your connection, but it will require both of you to stay committed to building trust and open communication.","You're at a crucial stage where things could go either way. If you continue to invest in each other, your bond has every chance of growing into something beautiful.","There\u2019s a balance between you that could tilt into deeper love with the right effort. Continue nurturing your bond, and the future could hold wonderful possibilities for both of you. Balance is the key to harmony."]),t.s)
B.AW=A.a(s(["Your love is blossoming, and while there may be small challenges, there's a solid foundation. Focus on communication and trust, and your relationship will continue to grow.","This is a connection with promise, one that, with continued effort and care, could turn into something deeply fulfilling. Don\u2019t be afraid to lean into the love that\u2019s developing.","There\u2019s a wonderful potential between you, and you're on the right track. If you continue to cherish and support each other, your bond will only grow stronger over time. Nurture what you have, and it will flourish."]),t.s)
B.Bz=A.a(s(["Congratulations on a strong connection! The bond between you is real and promising. Stay mindful of each other's needs, and your love will only deepen with time.","Your connection is on solid ground. Trust in the journey you're on together, and continue supporting one another. The love you share has the potential to be long-lasting and fulfilling.","You\u2019ve found something special. Keep nurturing this connection, and the future looks bright. With mutual effort, your love will continue to grow into something truly beautiful. The best is yet to come."]),t.s)
B.Ch=A.a(s(["Your relationship is thriving with harmony and understanding. Keep the lines of communication open, and continue to invest in each other. You're building something truly special.","Your bond is nearly seamless, with a balance that many strive for. Stay on this path of mutual respect and love, and watch your connection continue to blossom.","The love between you is strong and resilient. Keep nurturing this connection, and you'll continue to enjoy a deeply rewarding relationship. A bond like yours is rare; cherish it."]),t.s)
B.Bs=A.a(s(["Congratulations on a deeply harmonious and fulfilling connection! You and your partner complement each other perfectly, making this relationship a source of joy and strength.","You\u2019ve found a deep and rare connection that\u2019s built to last. Cherish what you have and continue to grow together in love and understanding. This relationship is something truly special.","Your bond is an example of what true love looks like. Continue nurturing each other, and the sky\u2019s the limit for what your relationship can achieve. True love multiplies joy and divides sorrows."]),t.s)
